description:
I Am Bruce Lee

Arts Documentary hosted by Pete McCormack, published by Spike TV in 2011 - English narration


Information
------------------------------

Bruce Lee is universally recognized as the pioneer who elevated martial arts in film to an art form, and this documentary will reveal why Bruce Lee's flame burns brighter now than the day he died over three decades ago. The greatest martial artists, athletes, actors, directors, and producers in the entertainment business today will share their feelings about the one who started it all. We will interview the people whose lives, careers, and belief systems were forever altered by the legendary &quot;Father of Martial Arts Cinema&quot;. Rarely seen archival footage and classic photos will punctuate the personal testimonials.

A Network Entertainment and Spike TV production.

